import React, { Component } from 'react';
import { withRouter } from 'react-router-dom';
import { withStyles, Grid, Typography, Container, Link } from '@material-ui/core';
import { withTranslation } from 'react-i18next';
import stylePage from './style';
import Header from '../../components/header';
import { CallMadeOutlined } from '@material-ui/icons';

import Footer from '../../components/footer';

class LandingPage extends Component {
  constructor(props) {
    super(props);

    this.state = {
      isAuth: this.props.isAuth,
      openAlert: false,
      referral: '',
    };
  }

  componentDidMount() {
    const query = new URLSearchParams(this.props.location.search);
    const referral = query.get('r') || 71249383;
    this.setState({ referral });
  }

  handleAlertClose() {
    this.setState({ openAlert: false });
  }

  render() {
    const { classes, t } = this.props;

    return (
      <>
        <Header />+
        <section container className={classes.location}>
          <Container>
            <Grid className={classes.location}>
              <div className={classes.locationCards}>
                <Typography component='p'>{t('landingPage.final1')}</Typography>
                <Typography component='h2'>{t('landingPage.final2')}</Typography>
                <div className={classes.locationCards1}>
                  <div></div>
                  <div>
                    <Typography component='h2'>{t('landingPage.cardFinal1')}</Typography>
                    <Typography component='h3'>{t('landingPage.cardFinal2')}</Typography>
                  </div>
                </div>
                <div className={classes.locationCards1}>
                  <div></div>
                  <div>
                    <Typography component='h2'>{t('landingPage.cardFinal3')}</Typography>
                    <Typography component='h3'>{t('landingPage.cardFinal4')}</Typography>
                  </div>
                </div>
              </div>
              <div>
                <iframe
                  className={classes.maps}
                  src='https://www.google.com/maps/embed?pb=!1m18!1m12!1m3!1d2993.1413767715585!2d2.163326175966825!3d41.39273599566339!2m3!1f0!2f0!3f0!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x12a4a2ed17e29c55%3A0x4c8746cfffe24b2c!2sC%2F%20d&#39;Arag%C3%B3%2C%20284%20bis%2C%202%C2%BA%201a%2C%2008007%20Barcelona%2C%20Espanha!5e0!3m2!1spt-BR!2sbr!4v1696532864469!5m2!1spt-BR!2sbr'
                  width='600'
                  height='300'
                  allowFullScreen=''
                  loading='lazy'
                  referrerPolicy='no-referrer-when-downgrade'
                  title='Mapa de localização'
                ></iframe>
              </div>
            </Grid>
          </Container>
        </section>
        <Footer />
      </>
    );
  }
}

export default withRouter(withStyles(stylePage)(withTranslation()(LandingPage)));
